function Tarif(props) {
    return (
        <div className="card">
            <div className="card-body">
               
                <h4 className="card-title">{props.name}</h4>
                <p className="card-text">{props.price}</p>
                <p>{props.speed}</p>
            </div>
            <div className="card-footer">
                <p>{props.name}</p>
                <p>{props.speed}</p>
            </div>
            
        </div>
        
    );
}
export default Tarif;
